#include <stdio.h>
#include <stdlib.h>
#include <Windows.h>

// –°—Ç—Ä—É–∫—Ç—É—Ä–∞ —É–∑–ª–∞ —Å—Ç–µ–∫–∞
struct Node {
    int data;
    struct Node* next;
};

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è –Ω–æ–≤–æ–≥–æ —É–∑–ª–∞
struct Node* newNode(int data) {
    struct Node* node = (struct Node*)malloc(sizeof(struct Node));
    node->data = data;
    node->next = NULL;
    return node;
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –¥–æ–±–∞–≤–ª–µ–Ω–∏—è —ç–ª–µ–º–µ–Ω—Ç–∞ –≤ —Å—Ç–µ–∫
void push(struct Node** root, int data) {
    struct Node* node = newNode(data);
    node->next = *root;
    *root = node;
    printf("%d –¥–æ–±–∞–≤–ª–µ–Ω–æ –≤ —Å—Ç–µ–∫.\n", data);
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —É–¥–∞–ª–µ–Ω–∏—è –≤—Å–µ—Ö —á–µ—Ç–Ω—ã—Ö —á–∏—Å–µ–ª –∏–∑ —Å—Ç–µ–∫–∞
void removeEvenNumbers(struct Node** root) {
    struct Node* current = *root;
    struct Node* prev = NULL;

    while (current != NULL) {
        if (current->data % 2 == 0) {
            if (prev == NULL) {
                *root = current->next;
                free(current);
                current = *root;
            } else {
                prev->next = current->next;
                free(current);
                current = prev->next;
            }
        } else {
            prev = current;
            current = current->next;
        }
    }
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –≤—ã–≤–æ–¥–∞ —Å–æ–¥–µ—Ä–∂–∏–º–æ–≥–æ —Å—Ç–µ–∫–∞
void printStack(struct Node* root) {
    if (root == NULL) {
        printf("–°—Ç–µ–∫ –ø—É—Å—Ç.\n");
        return;
    }
    printf("–°–æ–¥–µ—Ä–∂–∏–º–æ–µ —Å—Ç–µ–∫–∞: ");
    while (root != NULL) {
        printf("%d ", root->data);
        root = root->next;
    }
    printf("\n");
}

int main() {
    SetConsoleOutputCP(CP_UTF8);

    struct Node* stack = NULL;

    push(&stack, 1);
    push(&stack, 2);
    push(&stack, 3);
    push(&stack, 4);
    push(&stack, 5);

    printf("–ò—Å—Ö–æ–¥–Ω–æ–µ ");
    printStack(stack);

    removeEvenNumbers(&stack);

    printf("–°—Ç–µ–∫ –ø–æ—Å–ª–µ —É–¥–∞–ª–µ–Ω–∏—è —á–µ—Ç–Ω—ã—Ö —á–∏—Å–µ–ª: ");
    printStack(stack);

    return 0;
}

#define _CRT_SECURE_NO_WARNINGS

#include <stdio.h>
