void swap(int* a, int* b);
enum colors { eRed = 0, eWhite = 1, eBlue = 2 };
char* colorNames[] = {
    "–ö—Ä",
    "–ë–µ–ª",
    "–°–∏–Ω",
};

/*  task methods start  */
void dutchFlagSort(enum colors inpArr[], int arrSize)
{
    int low = 0;
    int high = arrSize - 1;
    int middle = 0;
    while (middle <= high) {
        switch (inpArr[middle]) {
            case 0:
                swap(&inpArr[low++], &inpArr[middle++]);
                break;
            case 1:
                middle++;
                break;
            case 2:
                swap(&inpArr[middle], &inpArr[high--]);
                break;
        }
    }
}

void swap(int* a, int* b)
{
    int temp = *a;
    *a = *b;
    *b = temp;
}
/*  task methods end  */

/*      print procs start      */
void printTaskInfo() {
    printf("\t–î–∞–Ω–Ω–∞—è –ø—Ä–æ–≥—Ä–∞–º–º–∞ —Ä–µ—à–∞–µ—Ç —Å–ª–µ–¥—É—é—â—É—é –∑–∞–¥–∞—á—É:\n");
    printf("–í –∫–∞–∂–¥–æ–π –ª—É–Ω–∫–µ –ª–µ–∂–∏—Ç –∫—Ä–∞—Å–Ω—ã–π, –±–µ–ª—ã–π –∏–ª–∏ —Å–∏–Ω–∏–π —à–∞—Ä. –û–¥–Ω–∏–º —Ö–æ–¥–æ–º —Ä–∞–∑—Ä–µ—à–∞–µ—Ç—Å—è –º–µ–Ω—è—Ç—å –º–µ—Å—Ç–∞–º–∏ –¥–≤–∞ –ª—é–±—ã—Ö —à–∞—Ä–∞.\n–î–æ–±–∏—Ç—å—Å—è —Ç–æ–≥–æ, —á—Ç–æ–±—ã –≤—Å–µ –∫—Ä–∞—Å–Ω—ã–µ —à–∞—Ä—ã —à–ª–∏ –ø–µ—Ä–≤—ã–º–∏, –≤—Å–µ —Å–∏–Ω–∏–µ - –ø–æ—Å–ª–µ–¥–Ω–∏–º–∏, –∞ –±–µ–ª—ã–µ - –ø–æ—Å–µ—Ä–µ–¥–∏–Ω–µ.\n");
}

void printArray(int arr[], int arr_size)
{
    for (int i = 0; i < arr_size; i++)
        printf("%s ", colorNames[arr[i]]);
}
/*      print procs end      */

int main()
{
    setlocale(LC_ALL, "Rus");
    printTaskInfo();

    enum colors inputArr[] = { eRed, eBlue, eWhite, eRed, eWhite, eBlue,eRed,eRed, eBlue, eBlue, eWhite, eWhite, eBlue };
    int arrSize = sizeof(inputArr) / sizeof(inputArr[0]);

    printf("\n–†–∞—Å–ø–æ–ª–æ–∂–µ–Ω–∏–µ —à–∞—Ä–æ–≤ –¥–æ —Å–æ—Ä—Ç–∏—Ä–æ–≤–∫–∏:\n");
    printArray(inputArr, arrSize);
    dutchFlagSort(inputArr, arrSize);
    printf("\n\n–†–∞—Å–ø–æ–ª–æ–∂–µ–Ω–∏–µ —à–∞—Ä–æ–≤ –ø–æ—Å–ª–µ —Å–æ—Ä—Ç–∏—Ä–æ–≤–∫–∏:\n");
    printArray(inputArr, arrSize);

    getch();
    return 0;
}

#include<bits/stdc++.h>
using namespace std;

bool check_duplicate(vector<int> v){
     /*
     Êé•Êî∂vector<int> ÂûãÊÖãÂà•ÁöÑËÆäÊï∏
     Ê™¢Ê∏¨vÈô£Âàó‰∏≠ÊúâÁÑ°ÈáçË§áÊï∏ÂÄº
     ÁÑ°ÈáçË§áÂõûÂÇ≥TRUE
     */
     int flag[10]={0};
     for(int i=0;i<v.size();++i){
          flag[v[i]]+=1;
          if(flag[v[i]]>1)return 0;
     }
     return 1;
}

bool check_length(int num, int length){
     /*
     Êé•Êî∂vector<int> ÂûãÊÖãÂà•ÁöÑËÆäÊï∏intÂûãÊÖãÂà•ÁöÑËÆäÊï∏‰ª£Ë°®ÈúÄÊ±ÇÈï∑Â∫¶
     Ê™¢Ê∏¨vÈô£ÂàóÈï∑Â∫¶ÊòØÂê¶Á¨¶ÂêàÈúÄÊ±ÇÈï∑Â∫¶
     Èï∑Â∫¶Ê≠£Á¢∫ÂõûÂÇ≥TRUE
     */
     int digit=0;
     while(num){
          num/=10;
          digit++;
     }
     return length==digit;
}

vector<int> input(int length){
     /*
     Êé•Êî∂intÂûãÊÖãÂà•ÁöÑËÆäÊï∏‰ª£Ë°®ÈúÄÊ±ÇÈï∑Â∫¶
     ËôïÁêÜËº∏ÂÖ•Êï∏Â≠óËΩâÈô£ÂàóÁöÑÈÉ®ÂàÜÔºåÂõûÂÇ≥ÂÄºÂûãÊÖãÂà•ÁÇ∫vector<int>
     ‰øùË≠âÂõûÂÇ≥Èô£ÂàóÁ¨¶ÂêàÈúÄÊ±ÇÈï∑Â∫¶‰∏îÁÑ°ÈáçË§áÊï∏ÂÄº
     */
     vector<int> v(length);
     cout<<"Please input number: ";
     while(true){
          int num,idx=length-1;
          cin>>num;
          if(!check_length(num, length)){
               cout<<"Wrong input length\n";
               continue;
          }
          while(num){
               v[idx--]=num%10;
               num/=10;
          }
          if(!check_duplicate(v)){
               cout<<"Duplicate numbers are not allowed\n";
               continue;
          }else{
               break;
          }
     }
     return v;
}

vector<int> set_number(int length, bool user_create=0){
     /*
     Êé•Êî∂intÂûãÊÖãÂà•ÁöÑËÆäÊï∏‰ª£Ë°®ÈúÄÊ±ÇÈï∑Â∫¶ÂíåboolÂûãÊÖãÂà•ÁöÑËÆäÊï∏‰ª£Ë°®ÊòØÂê¶ÈúÄË¶ÅÈö®Ê©üÁîüÊàêÊï∏Âàó
     ËôïÁêÜÁîüÊàêÁ≠îÊ°àÊï∏ÂàóÁöÑÈÉ®ÂàÜÔºåÂõûÂÇ≥ÂÄºÂûãÊÖãÂà•ÁÇ∫vector<int>
     ‰øùË≠âÂõûÂÇ≥Èô£ÂàóÁ¨¶ÂêàÈúÄÊ±ÇÈï∑Â∫¶‰∏îÁÑ°ÈáçË§áÊï∏ÂÄº
     */
     bool flag[10]={0};
     vector<int> v(length);
     if(user_create){
          return input(length);
     }
     for(int i=0,tmp;i<length;++i){
          do{
               tmp = rand()%10;
          }while(flag[tmp]);
          flag[tmp]=1;
          v[i]=tmp;
     }
     return v;
}

bool calculate(vector<int> ans, vector<int> input){
     int a_num=0, b_num=0;
     for(int i=0;i<input.size();++i){
          for(int j=0;j<ans.size();++j){
               if(ans[j]==input[i]){
                    if(i==j)a_num++;
                    else b_num++;
               }
          }
     }
     cout<<a_num<<'A'<<b_num<<"B"<<'\n';
     
     return ans.size()==a_num;
}

bool deter(vector<int> ans, vector<int> input)
{
     int n=ans.size();
     int A=0,B=0;
     for(int i=0;i<n;i++)
     {
          if(ans[i]==input[i])
          {
               A++;
          }
          else
          {
               for(int count=0;count<n;count++)
               {
                    if(input[i]==ans[count])
                    {
                         B++;
                         break;
                    }
               }
          }
     }
     cout<<A<<"A"<<B<<"B"<<'\n';
     return A==n;
}
void single_mode(){
     //ÂñÆ‰∫∫ÈÅäÊà≤Ê®°Âºè‰∏ªÂáΩÂºè
     vector<int> ans, tmp;
     int length;
     string create;

     cout<<"set length: ";
     cin>>length;
     cout<<"Do you want to randomly generate numbers?(Yes or No) ";
     while(true){
          cin>>create;
          if(create=="Yes"){
               ans = set_number(length);
               break;
          }else if(create=="No"){
               ans = set_number(length, 1);
               break;
          }else{
               cout<<"Please input Yes or No\n";
          }
     }

     cout<<"Game Start\n";
     while(true){
          cout<<"Please enter your answer: ";
          tmp = input(length);
          if(deter(ans, tmp)){
               cout<<"You win!!!!\n";
               break;
          }
     }
}

int main(){
     srand(time(NULL));
     single_mode();
     return 0;
}

#include <iostream>
#include <string>
#include <regex>
#include <fstream>

using namespace std;

typedef enum TSymbolType {
    integer, text, semicolon, period, quotas, othersy
} TSymbol;

const char* SymbolNames[] = {
    "integer", "text", "semicolon", "period", "quotas", "othersy"
};

TSymbol Symbol;
const int MAXLENGTH = 255;
const int MAXINTEGER = 1000000;
char Spelling[MAXLENGTH];
int Constant = 0;
char Char;

ifstream inputFile("C://Users//Aleksandar//source//repos//Parser//Parser//input.txt");

void error(const char* str) {
    cerr << "Error: " << str << endl;
    exit(EXIT_FAILURE);
}

void GetNextChar() {
    inputFile.get(Char);
}

void GetNextSymbol() {
    while (Char == ' ') {
        GetNextChar();
    }

    switch (Char) {
    case '0':
    case '1':
    case '2':
    case '3':
    case '4':
    case '5':
    case '6':
    case '7':
    case '8':
    case '9': {
        Constant = 0;
        while (Char >= '0' && Char <= '9') {
            int digit = Char - '0';
            if (Constant < MAXINTEGER / 10 || (Constant == MAXINTEGER / 10 && digit <= MAXINTEGER % 10)) {
                Constant = 10 * Constant + digit;
            }
            else {
                error("Integer constant too large.");
                Constant = 0;
            }
            GetNextChar();
        }
        Symbol = integer;
    } break;
    case 'A': case 'B': case 'C': case 'D': case 'E': case 'F': case 'G':
    case 'H': case 'I': case 'J': case 'K': case 'L': case 'M': case 'N':
    case 'O': case 'P': case 'Q': case 'R': case 'S': case 'T': case 'U':
    case 'V': case 'W': case 'X': case 'Y': case 'Z':
    case 'a': case 'b': case 'c': case 'd': case 'e': case 'f': case 'g':
    case 'h': case 'i': case 'j': case 'k': case 'l': case 'm': case 'n':
    case 'o': case 'p': case 'q': case 'r': case 's': case 't': case 'u':
    case 'v': case 'w': case 'x': case 'y': case 'z': {
        int k = 0;
        do {
            if (k < MAXLENGTH) {
                Spelling[k] = toupper(Char);
                k++;
            }
            GetNextChar();
        } while (isalnum(Char));
        Spelling[k] = '\0';
        Symbol = text;
    } break;

    case ';': {
        Symbol = semicolon;
        GetNextChar();
    } break;

    case '.': {
        Symbol = period;
        GetNextChar();
    } break;

    case '"': {
        Symbol = quotas;
        GetNextChar();
    } break;

    default: {
        Symbol = othersy;
        GetNextChar();
    } break;
    }


}

int accept(TSymbol sym) {
    if (Symbol == sym) {
        GetNextSymbol();
        return 1;
    }
    return 0;
}

int expect(TSymbol sym) {
    if (accept(sym))
        return 1;
    error("Expected symbol not found.");
    return 0;
}

void Field() {
    if (accept(integer)) {
        cout << "Integer: " << Constant << endl;
    }
    else if (accept(quotas)) {
        cout << "String: " << Spelling << endl;
        if (Symbol == period) {
            accept(period);
            Field();
        }
        else {
            expect(text);
            expect(quotas);
        }
    }
    else {
        error("Field expects integer or string.");
    }
}

void Record() {
    Field();
    while (Symbol == semicolon || Symbol == period) {
        if (Symbol == semicolon) {
            accept(semicolon);
        }
        else {
            accept(period);
        }
        Field();
    }
}

void DataFile() {
    GetNextSymbol();
    Record();
}

int main() {
    if (!inputFile.is_open()) {
        error("Unable to open file.");
    }
    GetNextChar();
    DataFile();
    inputFile.close();
    return 0;
}

