    for (int x=0; x<cantPart; x++){
        regPart = archPart.leerRegistro(x);
        if  (fechaNueva.getAnio() < regPart.getFechaRealizacion().getAnio() && regPart.getEstado()){
            cont++;
        }
    }

    Partidos *v;

    v=new Partidos[cont];
