    int pos=0;

    for (int x=0; x<cantPart; x++){
        regPart = archPart.leerRegistro(x);
        if (regPart.getEstado()){
            v[pos] = regPart;
            pos++;
        }
    }

    for (int x=0; x<cont; x++){
        v[x].Mostrar();
    }

    delete[] v;
}



