        }
        int contarRegistros(){
            FILE *p;
            p=fopen(nombre, "rb");
            if(p==NULL) return -1;
            fseek(p, 0,2);
            int tam=ftell(p);
            fclose(p);
            return tam/sizeof(Partidos);
        }
};

void punto3(){
    ArchivoPartido archPart("Partidos.dat");
    int cantPart = archPart.contarRegistros();
    Partidos regPart;

    Partidos *v;

    if (cantPart <= 0){
        cout<< "No hay registros" << endl;
        return;
    }

    v=new Partidos[cantPart];
    if(v==NULL) return;

    int pos=0;

    for (int x=0; x<cantPart; x++){
        regPart = archPart.leerRegistro(x);
        v[pos] = regPart;
        pos++;
    }

    for (int x=0; x<cantPart; x++){
        v[x].Mostrar();
    }

    delete[] v;
}



